//canvas1

const myImage1 = new Image();
myImage1.src = 'data:image/jpeg;base64,';


myImage1.addEventListener('load', function(){
    const canvas1 = document.getElementById('canvas1');
    const ctx1 = canvas1.getContext('2d');
    canvas1.width = 500;
    canvas1.height = 600;
    
    ctx1.drawImage(myImage1, 0, 0, canvas1.width, canvas1.height);
    const pixels1 = ctx1.getImageData(0, 0, canvas1.width, canvas1.height);
    ctx1.clearRect(0, 0, canvas1.width, canvas1.height);

    let particleArray1 = [];
    const numeberOfParticles1 = 5000;

    let mappedImage1 = [];
    for ( let y = 0; y < canvas1.height; y++) {
        let row = [];
        for (let x = 0 ; x < canvas1.width; x++) {
            const red = pixels1.data[(y * 4 * pixels1.width) + (x * 4)];
            const green = pixels1.data[(y * 4 * pixels1.width) + (x * 4 + 1)];
            const blue = pixels1.data[(y * 4 * pixels1.width) + (x * 4 + 2)];
            const brightness = calculateRelativeBrightness(red, green, blue);
            const cell = [
                cellBirghtness = brightness, 
            ];
            row.push(cell);
        }
        mappedImage1.push(row);
    }

    function calculateRelativeBrightness(red, green, blue) {
        return Math.sqrt(
            (red * red) * 0.299 +
            (green * green) * 0.587 + 
            (blue * blue) * 0.114
        )/100;
    }

    class Particle1 {
        constructor() {
            this.x = Math.random() * canvas1.width;
            this.y = 0;
            this.speed = 0;
            this.velocity = Math.random() * 0.5;
            this.size = Math.random() * 1.5 + 1;
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
        }
        update() {
            this.position1 = Math.floor(this.y);
            this.position2 = Math.floor(this.x);
            this.speed = mappedImage1[this.position1][this.position2][0];
            let movement = (2.5 - this.speed) + this.velocity;
            this.y += movement; 
            if (this.y >= canvas1.height) {
                this.y = 0;
                this.x = Math.random() * canvas1.width;
            }
        }
        draw(){
            this.speed = mappedImage1[this.position1][this.position2][0];
            ctx1.beginPath();
            if(this.speed < 0.2) {
                ctx1.fillStyle = 'black';
            } else if (this.speed > 1.1) {
                ctx1.fillStyle = 'white';
            } else {
                ctx1.fillStyle = '#ff9a3c';
            }
            ctx1.arc(this.x, this.y, this.size, 0, Math.PI * 2);
            ctx1.fill();
        }
    }
    function init1(){
        for (let i = 0; i < numeberOfParticles1; i++) {
            particleArray1.push( new Particle1);
        }
    }
    init1();
    function animate1() {
        ctx1.globalAlpha = 0.09;
        ctx1.fillStyle = 'rgba(0, 0, 0)';
        ctx1.fillRect(0, 0, canvas1.width, canvas1.height);
        ctx1.globalAlpha = 0.3;
        for (let i = 0; i < particleArray1.length; i++) {
            particleArray1[i].update();
            ctx1.globalAlpha = particleArray1[i].speed * 0.3;
            particleArray1[i].draw();
        }
        requestAnimationFrame(animate1);
    }
    animate1();
})


